// SPDX-License-Identifier: MIT
pragma solidity ^0.8.11;
pragma experimental ABIEncoderV2;

import "./User.sol";
import "./Product.sol";
import "./OrderRequestInfo.sol";

contract Distributor {
    User user;

    constructor(address _userAddress) {
        user = User(_userAddress);
    }

    mapping(address => address[]) public ProductBatchesAssignedToTransporter;
    mapping(address => address[]) public RegisteredProductBatches;

    modifier onlyDistributor() {
        require(user.getUserRole(msg.sender) == 2, "ODCC");
        _;
    }

    event ProductBatchUpdatedEvt(
        address indexed productId,
        uint256 status,
        uint256 totalRegProductCount
    );

    event OrderStatusEvt(
        address indexed orderRequestId,
        uint256 orderStatus,
        uint256 submissionTimestamp,
        uint256 orderModifiedDate
    );

    function registerProductBatch(
        string memory _productName,
        string memory _productDesc,
        string memory _warehouseLoc,
        uint256 _quantity,
        uint256 _price,
        uint256 _totalPrice,
        string memory _manufacturerName,
        string memory _manufacturerLoc,
        address _transporter, // logistic
        address _retailer, // receiver
        address _orderRequestId
    ) public onlyDistributor {
        if (
            OrderRequestInfo(_orderRequestId).getOrderRequestStatus() == 2 &&
            validateProductBatch(
                _orderRequestId,
                _quantity,
                _productName,
                _manufacturerName
            )
        ) {
            Product productBatch = new Product(
                _orderRequestId,
                _productName,
                _productDesc,
                _warehouseLoc,
                _quantity,
                _price,
                _manufacturerName,
                _manufacturerLoc,
                _transporter,
                _retailer,
                msg.sender
            );
            RegisteredProductBatches[msg.sender].push(address(productBatch));
            OrderRequestInfo(_orderRequestId).inProcess();
            emit ProductBatchUpdatedEvt(
                address(productBatch),
                Product(address(productBatch)).getProductBatchStatus(),
                RegisteredProductBatches[msg.sender].length
            );
            emit OrderStatusEvt(
                _orderRequestId,
                OrderRequestInfo(_orderRequestId).getOrderRequestStatus(),
                OrderRequestInfo(_orderRequestId).getOrderSubmissionTimestamp(),
                OrderRequestInfo(_orderRequestId).getOrderModifiedDate()
            );
        } else {
            revert("ORDER_NOT_YET_ACCEPTED");
        }
    }

    function initiateProductShipment(address _productId, address _transporter)
        public
        onlyDistributor
    {
        if (Product(_productId).initiateTransit()) {
            ProductBatchesAssignedToTransporter[_transporter].push(_productId);
            emit ProductBatchUpdatedEvt(
                _productId,
                Product(_productId).getProductBatchStatus(),
                RegisteredProductBatches[msg.sender].length
            );
        }
    }

    function cancelInitiatedShipment(address _productId, string memory _reason)
        public
        onlyDistributor
    {
        if (Product(_productId).cancelProductShipment(_reason)) {
            emit ProductBatchUpdatedEvt(
                _productId,
                Product(_productId).getProductBatchStatus(),
                RegisteredProductBatches[msg.sender].length
            );
        }
    }

    function validateProductBatch(
        address _orderRequestId,
        uint256 _quantity,
        string memory _productName,
        string memory _manufacturerDetail
    ) private view returns (bool flag) {
        OrderInfo memory _orderInfo = OrderRequestInfo(_orderRequestId)
            .getOrderRequestInfo();
        if (_orderInfo.quantity != _quantity) {
            revert("QTY_MISMATCH");
        } else if (
            keccak256(bytes(_orderInfo.productName)) !=
            keccak256(bytes(_productName))
        ) {
            revert("PROD_NAME_MISMATCH");
        } else if (
            keccak256(bytes(_orderInfo.manufacturerDetail)) !=
            keccak256(bytes(_manufacturerDetail))
        ) {
            revert("MANUF_MISMATCH");
        }

        return true;
    }

    //get list of registered product batches by distributor
    function getAllRegisteredProductBatches(address _distributor)
        public
        view
        returns (address[] memory)
    {
        return RegisteredProductBatches[_distributor];
    }

    //get list of product batches initiated for transfer by distributor to transporter
    function getTransporterAssignedProductBatches(address _transporter)
        public
        view
        returns (address[] memory)
    {
        return ProductBatchesAssignedToTransporter[_transporter];
    }

    //Retrieve product details
    //@param _productId Address product Id
    function getProductDetails(address _productId)
        public
        view
        returns (
            ProductBasicInfo memory productBasicInfo,
            ProductAdvanceInfo memory productAdvanceInfo,
            uint256 _status
        )
    {
        return Product(_productId).getProductInfo();
    }
